import React from "react";
import ProgrammersCard from "./ProgrammersCard";
function ProgrammersGrid() {
  const info = [
    {
      id: 1,
      name: "fatima",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/200/100",
      website: "http//one",
    },
    {
      name: "fatten",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/200/100",
    },
    {
      name: "rama",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/200/100",
    },
    {
      name: "emma",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/200/100",
      website: "http//one,",
    },
    {
      name: "hya",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/400/200",
      website: "http//one,",
    },
    {
      name: "lora",
      jop: "programmer",
      phone: "3445253",
      image: "https://picsum.photos/200/100",
    },
  ];
  const members = info.map((member) => (
    <ProgrammersCard
      key={member.id}
      name={member.name}
      jop={member.jop}
      phone={member.phone}
      image={member.image}
      website={member.website}
    />
  ));
  return (
    <div class="row justify-content-md-center ms-6">
      {members}
    </div>
  );
}
export default ProgrammersGrid;
